import { Box } from "@mui/system";
import {
  FormLabel,
  TextField,
  FormControlLabel,
  Checkbox,
} from "@mui/material";
import Button from "@mui/material/Button";
import React from "react";

function AddBook() {
  const [inputs, setInputs] = uIeState({
    name: "",
    author: "",
    desc: "",
    price: 0,
    img: "",
    available: false,
  });

  return (
    <form>
      <Box
        display="flex"
        flexDirection="column"
        maxWidth={700}
        marginTop={10}
        marginLeft="auto"
        marginRight="auto"
      >
        <FormLabel>Name</FormLabel>
        <TextField
          value={inputs.name}
          fullWidth
          name="name"
          variant="outlined"
        />
        <FormLabel>Author</FormLabel>
        <TextField
          value={inputs.author}
          fullWidth
          name="author"
          variant="outlined"
        />
        <FormLabel>Description</FormLabel>
        <TextField
          value={inputs.desc}
          fullWidth
          name="desc"
          variant="outlined"
        />
        <FormLabel>Price</FormLabel>
        <TextField
          value={inputs.price}
          type="number"
          fullWidth
          name="price"
          variant="outlined"
        />
        <FormLabel>Image</FormLabel>
        <TextField value={inputs.img} fullWidth name="img" variant="outlined" />
        <FormControlLabel
          control={<Checkbox checked={false} />}
          label="Available"
        />
        <Button variant="contained" type="submit">
          Add Book
        </Button>
      </Box>
    </form>
  );
}

export default AddBook;
